import ChatBot from 'react-simple-chatbot';



const Chatbot = () => {
    const steps = [
    {
        id: '0',
        message: 'Welcome to react chatbot!',
        trigger: '1',
    },
    {
        id: '1',
        message: 'Bye!',
        end: true,
    },
    ];

    ReactDOM.render(
    <div>
        <ChatBot steps={steps} />
    </div>,
    document.getElementById('root')
    );

}

export default Chatbot;
